import React, { useState, useRef, useEffect } from "react";
import { useNavigate, Link, NavLink } from "react-router-dom";
import "./signup.css";
import { toast } from "react-toastify";

// import {
//   Avatar,
//   Grid,
//   Paper,
//   Typography,
//   TextField,
//   Button,
//   InputAdornment,
//   IconButton,
// } from "@mui/material";
// import VisibilitySharpIcon from "@mui/icons-material/VisibilitySharp";
// import VisibilityOffSharpIcon from "@mui/icons-material/VisibilityOffSharp";
// import AddCircleOutlineOutlinedIcon from "@mui/icons-material/AddCircleOutlineOutlined";

function SignUpForm() {
  // const [username, setUsername] = useState("");
  // const [email, setEmail] = useState("");
  // const [password, setPassword] = useState("");
  // const [confirm_password, setConfirmPassword] = useState("");
  // const [showPassword, setShowPassword] = useState(false);
  // const [phone_number, setPhoneNumber] = useState(0);
  const navigate = useNavigate();
  const [errors, setErrors] = useState([]);

  const [values, setValues] = useState({
    username: "",
    email: "",
    password: "",
    confirmPassword: "",
    phoneNumber: 0,
    showPassword: false,
  });

  // const inputs = [
  //   {
  //     id: 1,
  //     name: "username",
  //     type: "text",
  //     placeholder: "Enter your username",
  //     required: true,
  //     label: "Username",
  //   },
  //   {
  //     id: 2,
  //     name: "email",
  //     type: "email",
  //     placeholder: "Enter your email address",
  //     required: true,
  //     label: "Email",
  //   },
  //   {
  //     id: 3,
  //     name: "phoneNumber",
  //     type: "number",
  //     placeholder: "Enter your phone number",
  //     label: "Phone Number",
  //   },
  //   {
  //     id: 4,
  //     name: "password",
  //     type: "password",
  //     placeholder: "Enter your password",
  //     errorMessage:
  //       "Password should be 8-20 characters and include at least 1 letter, 1 number and 1 special character!",
  //     label: "Password",
  //     pattern: `^(?=.*[0-9])(?=.*[a-zA-Z])(?=.*[!@#$%^&*])[a-zA-Z0-9!@#$%^&*]{8,20}$`,
  //     required: true,
  //   },
  //   {
  //     id: 5,
  //     name: "confirmPassword",
  //     type: "text",
  //     placeholder: "Confirm your password",
  //     errorMessage: "Passwords don't match!",
  //     label: "Confirm Password",
  //     pattern: values.password,
  //     required: true,
  //   },
  // ];

  function handleSubmit(e) {
    e.preventDefault();
    fetch("/clients", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(values),
    }).then((res) => {
      if (res.ok) {
        toast.success("Account created successfully");
        navigate("/login");
      } else {
        res.json().then((errorData) => setErrors(errorData.errors));
        toast.error("Could not create account");
      }
    });
  }
  localStorage.setItem("user-info", JSON.stringify(values));

  const onChange = (e) => {
    setValues({ ...values, [e.target.name]: e.target.value });
  };
  // Toggling password visibility
  // const handlePasswordVisibility = () => {
  //   values.showPassword ? setValues(false) : setShowPassword(true);
  // };

  return (
    <div className="signup-container">
      <form onSubmit={handleSubmit} className="signup-form">
        <h1>Create Account</h1>
        <div class="form-floating mb-3">
          <input
            type="text"
            name="username"
            className="form-control"
            id="floatingInput"
            placeholder="Name"
            onChange={onChange}
          />
          <label htmlFor="floatingInput">Name</label>
        </div>
        <div className="form-floating mb-3">
          <input
            type="email"
            name="email"
            className="form-control"
            id="floatingInput"
            placeholder="name@example.com"
            onChange={onChange}
          />
          <label htmlFor="floatingInput">Email address</label>
        </div>{" "}
        <div className="form-floating">
          <input
            type="number"
            name="phoneNumber"
            className="form-control"
            id="floatingPassword"
            placeholder="Phone"
          />
          <label htmlFor="floatingPassword">Phone</label>
        </div>
        <div className="form-floating mb-3">
          <input
            type="password"
            name="password"
            className="form-control"
            id="floatingInput"
            placeholder="Password"
            onChange={onChange}
          />
          <label htmlFor="floatingInput">Password</label>
        </div>
        <div className="form-floating">
          <input
            type="password"
            name="confirmPassword"
            className="form-control"
            id="floatingPassword"
            placeholder="Confirm password"
          />
          <label htmlFor="floatingPassword">Confirm password</label>
        </div>
        <button className="sign-btns" type="submit">
          Sign Up
        </button>
        <div id="already-sign">
          <p className="already">Already signed up?</p>
          <button className="sign-btns" id="signin-btn" type="submit">
            <NavLink className="signin" to="/login">
              Sign In
            </NavLink>
          </button>
        </div>
      </form>
    </div>
  );
}

export default SignUpForm;
